import React, { useState, ChangeEvent } from 'react';

interface PersonalInfo {
  firstName: string;
  middleName: string;
  lastName: string;
  dateOfBirth: string;
  gender: string;
  countryOfOrigin: string;
  preferredLanguage: string;
  phoneNumber: string;
  email: string;
  streetAddress: string;
  city: string;
  zipCode: string;
  county: string;
  state: string;
  mailingAddress: string;
  sameAsResidential: boolean;
  dshsClientId: string;
  alienNumber: string;
}

interface ImmigrationStatus {
  status: string;
  eligibilityDate: string;
  notes: string;
}

interface ProgramEligibility {
  receivingServices: boolean;
  isOver16: boolean;
  livesInWashington: boolean;
  arrivedAfterJuly2021: boolean;
  hasApprovedStatus: boolean;
}

interface Services {
  outreach: boolean;
  culturalOrientation: boolean;
  informationReferrals: boolean;
  resourceNavigation: boolean;
  supportServices: boolean;
  other: boolean;
  otherDescription: string;
}

interface FormData {
  organizationName: string;
  navigatorName: string;
  intakeDate: string;
  participant: PersonalInfo;
  immigrationStatus: ImmigrationStatus;
  programEligibility: ProgramEligibility;
  services: Services;
}

const CommunityIntakeForm: React.FC = () => {
  const [formData, setFormData] = useState<FormData>({
    organizationName: '',
    navigatorName: '',
    intakeDate: '',
    participant: {
      firstName: '',
      middleName: '',
      lastName: '',
      dateOfBirth: '',
      gender: '',
      countryOfOrigin: '',
      preferredLanguage: '',
      phoneNumber: '',
      email: '',
      streetAddress: '',
      city: '',
      zipCode: '',
      county: '',
      state: 'Washington',
      mailingAddress: '',
      sameAsResidential: false,
      dshsClientId: '',
      alienNumber: ''
    },
    immigrationStatus: {
      status: '',
      eligibilityDate: '',
      notes: ''
    },
    programEligibility: {
      receivingServices: false,
      isOver16: false,
      livesInWashington: false,
      arrivedAfterJuly2021: false,
      hasApprovedStatus: false
    },
    services: {
      outreach: false,
      culturalOrientation: false,
      informationReferrals: false,
      resourceNavigation: false,
      supportServices: false,
      other: false,
      otherDescription: ''
    }
  });

  const immigrationStatuses = [
    'Refugee',
    'Asylum',
    'Cuban and Haitian entrants',
    'Amerasians',
    'Certified victims of human trafficking',
    'Iraqi and Afghan Special Immigrants',
    'Afghan Humanitarian Parolees',
    'Ukrainian Humanitarian Parolees'
  ];

  const handleChange = (e: ChangeEvent<HTMLInputElement>) => {
    const { name, value, type, checked } = e.target;

    if (name.includes('.')) {
      const [section, field] = name.split('.');
      setFormData(prev => {
        const sectionData = prev[section as keyof FormData];
        if (typeof sectionData === 'object' && sectionData !== null) {
          return {
            ...prev,
            [section]: {
              ...sectionData,
              [field]: type === 'checkbox' ? checked : value
            }
          };
        }
        return prev;
      });
    } else {
      setFormData(prev => ({
        ...prev,
        [name]: type === 'checkbox' ? checked : value
      }));
    }
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    console.log(formData);
  };

  return (
    <div style={{ maxWidth: '1000px', margin: '0 auto', padding: '20px' }}>
      <h1 style={{ textAlign: 'center', marginBottom: '20px' }}>
        Community Outreach and Education Intake/Registration Form
      </h1>

      <form onSubmit={handleSubmit}>
        {/* Basic Information */}
        <div style={{ marginBottom: '20px' }}>
          <div style={{ display: 'grid', gridTemplateColumns: 'repeat(3, 1fr)', gap: '10px' }}>
            <div>
              <label>Organization Name</label>
              <input
                type="text"
                name="organizationName"
                value={formData.organizationName}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
            <div>
              <label>Navigator Name</label>
              <input
                type="text"
                name="navigatorName"
                value={formData.navigatorName}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
            <div>
              <label>Intake Date</label>
              <input
                type="date"
                name="intakeDate"
                value={formData.intakeDate}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
          </div>
        </div>

        {/* Participant Information */}
        <div style={{ marginBottom: '20px', border: '1px solid #ccc', padding: '15px' }}>
          <h2 style={{ marginBottom: '15px' }}>Participant Information</h2>
          <div style={{ display: 'grid', gridTemplateColumns: 'repeat(3, 1fr)', gap: '10px' }}>
            <div>
              <label>First Name</label>
              <input
                type="text"
                name="participant.firstName"
                value={formData.participant.firstName}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
            <div>
              <label>Middle Name</label>
              <input
                type="text"
                name="participant.middleName"
                value={formData.participant.middleName}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
            <div>
              <label>Last Name</label>
              <input
                type="text"
                name="participant.lastName"
                value={formData.participant.lastName}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
            <div>
              <label>Date of Birth</label>
              <input
                type="date"
                name="participant.dateOfBirth"
                value={formData.participant.dateOfBirth}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
            <div>
              <label>Gender</label>
              <input
                type="text"
                name="participant.gender"
                value={formData.participant.gender}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
            <div>
              <label>Country of Origin</label>
              <input
                type="text"
                name="participant.countryOfOrigin"
                value={formData.participant.countryOfOrigin}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
            <div>
              <label>Preferred Language</label>
              <input
                type="text"
                name="participant.preferredLanguage"
                value={formData.participant.preferredLanguage}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
            <div>
              <label>Phone Number</label>
              <input
                type="tel"
                name="participant.phoneNumber"
                value={formData.participant.phoneNumber}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
            <div>
              <label>Email</label>
              <input
                type="email"
                name="participant.email"
                value={formData.participant.email}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
            <div style={{ gridColumn: 'span 2' }}>
              <label>Street Address (Residential)</label>
              <input
                type="text"
                name="participant.streetAddress"
                value={formData.participant.streetAddress}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
            <div>
              <label>City</label>
              <input
                type="text"
                name="participant.city"
                value={formData.participant.city}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
            <div>
              <label>Zip Code</label>
              <input
                type="text"
                name="participant.zipCode"
                value={formData.participant.zipCode}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
            <div>
              <label>County</label>
              <input
                type="text"
                name="participant.county"
                value={formData.participant.county}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
            <div>
              <label>DSHS Client ID #</label>
              <input
                type="text"
                name="participant.dshsClientId"
                value={formData.participant.dshsClientId}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
            <div>
              <label>Alien #</label>
              <input
                type="text"
                name="participant.alienNumber"
                value={formData.participant.alienNumber}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
          </div>
          <div style={{ marginTop: '10px' }}>
            <label style={{ display: 'flex', alignItems: 'center' }}>
              <input
                type="checkbox"
                name="participant.sameAsResidential"
                checked={formData.participant.sameAsResidential}
                onChange={handleChange}
                style={{ marginRight: '8px' }}
              />
              Mailing address same as residential
            </label>
            {!formData.participant.sameAsResidential && (
              <div style={{ marginTop: '10px' }}>
                <label>Mailing Address</label>
                <input
                  type="text"
                  name="participant.mailingAddress"
                  value={formData.participant.mailingAddress}
                  onChange={handleChange}
                  style={{ width: '100%', padding: '8px', marginTop: '5px' }}
                />
              </div>
            )}
          </div>
        </div>

        {/* Immigration Status */}
        <div style={{ marginBottom: '20px', border: '1px solid #ccc', padding: '15px' }}>
          <h2 style={{ marginBottom: '15px' }}>Current Immigration Status</h2>
          <div style={{ display: 'flex', flexDirection: 'column', gap: '10px' }}>
            {immigrationStatuses.map(status => (
              <label key={status} style={{ display: 'flex', alignItems: 'center' }}>
                <input
                  type="radio"
                  name="immigrationStatus.status"
                  value={status}
                  checked={formData.immigrationStatus.status === status}
                  onChange={handleChange}
                  style={{ marginRight: '8px' }}
                />
                {status}
              </label>
            ))}
          </div>
          <div style={{ marginTop: '15px' }}>
            <label>Eligibility Date</label>
            <input
              type="date"
              name="immigrationStatus.eligibilityDate"
              value={formData.immigrationStatus.eligibilityDate}
              onChange={handleChange}
              style={{ width: '100%', padding: '8px', marginTop: '5px' }}
            />
          </div>
        </div>

        {/* Program Eligibility */}
        <div style={{ marginBottom: '20px', border: '1px solid #ccc', padding: '15px' }}>
          <h2 style={{ marginBottom: '15px' }}>Program Eligibility Determination</h2>
          <div style={{ display: 'flex', flexDirection: 'column', gap: '10px' }}>
            <label style={{ display: 'flex', alignItems: 'center' }}>
              <input
                type="checkbox"
                name="programEligibility.receivingServices"
                checked={formData.programEligibility.receivingServices}
                onChange={handleChange}
                style={{ marginRight: '8px' }}
              />
              Receiving services from resettlement agencies
            </label>
            <label style={{ display: 'flex', alignItems: 'center' }}>
              <input
                type="checkbox"
                name="programEligibility.isOver16"
                checked={formData.programEligibility.isOver16}
                onChange={handleChange}
                style={{ marginRight: '8px' }}
              />
              16 years of age or older
            </label>
            <label style={{ display: 'flex', alignItems: 'center' }}>
              <input
                type="checkbox"
                name="programEligibility.livesInWashington"
                checked={formData.programEligibility.livesInWashington}
                onChange={handleChange}
                style={{ marginRight: '8px' }}
              />
              Lives in Washington
            </label>
            <label style={{ display: 'flex', alignItems: 'center' }}>
              <input
                type="checkbox"
                name="programEligibility.arrivedAfterJuly2021"
                checked={formData.programEligibility.arrivedAfterJuly2021}
                onChange={handleChange}
                style={{ marginRight: '8px' }}
              />
              Arrived after July 1, 2021
            </label>
          </div>
        </div>

        {/* Services */}
        <div style={{ marginBottom: '20px', border: '1px solid #ccc', padding: '15px' }}>
          <h2 style={{ marginBottom: '15px' }}>Services</h2>
          <div style={{ display: 'flex', flexDirection: 'column', gap: '10px' }}>
            {[
              ['outreach', 'Outreach'],
              ['culturalOrientation', 'Community & Cultural Orientation'],
              ['informationReferrals', 'Information and Referrals'],
              ['resourceNavigation', 'Resource Navigation'],
              ['supportServices', 'Support Services'],
              ['other', 'Other']
            ].map(([key, label]) => (
              <label key={key} style={{ display: 'flex', alignItems: 'center' }}>
                <input
                  type="checkbox"
                  name={`services.${key}`}
                  checked={formData.services[key as keyof Services] as boolean}
                  onChange={handleChange}
                  style={{ marginRight: '8px' }}
                />
                {label}
              </label>
            ))}
            {formData.services.other && (
              <div style={{ marginTop: '10px' }}>
                <label>Other Description</label>
                <input
                  type="text"
                  name="services.otherDescription"
                  value={formData.services.otherDescription}
                  onChange={handleChange}
                  style={{ width: '100%', padding: '8px', marginTop: '5px' }}
                />
              </div>
            )}
          </div>
        </div>

        <div style={{ display: 'flex', justifyContent: 'flex-end', marginTop: '20px' }}>
          <button
            type="submit"
            style={{
              backgroundColor: '#4299e1',
              color: 'white',
              padding: '10px 20px',
              borderRadius: '4px',
              border: 'none',
              cursor: 'pointer'
            }}
          >
            Submit
          </button>
        </div>
      </form>
    </div>
  );
};

export default CommunityIntakeForm;
